  {
   "cell_type": "markdown",
   "id": "cf08fe23",
   "metadata": {},
   "source": [
    "* View the first five rows of the DataFrame df. Is it tidy? Why or why not?\n",
    "\n",
    "\n",
    "* Yes, because there are no typos or missing values.\n",
    "\n",
    "* Yes, because it is well organized and easy to read.\n",
    "\n",
    "* No, because a single column contains different types of information.\n",
    "\n",
    "\n",
    "Good job. Always make sure to check if your DataFrame is tidy before using it with Seaborn.\n",
    "\n",
    "## Making a count plot with a DataFrame\n",
    "In this exercise, we'll look at the responses to a survey sent out to young people. Our primary question here is: how many young people surveyed report being scared of spiders? Survey participants were asked to agree or disagree with the statement \"I am afraid of spiders\". Responses vary from 1 to 5, where 1 is \"Strongly disagree\" and 5 is \"Strongly agree\".\n",
    "\n",
    "To get you started, the filepath to the csv file with the survey data has been assigned to the variable csv_filepath.\n",
    "\n",
    "Note that because `csv_filepath` is a Python variable, you will not need to put quotation marks around it when you read the csv.\n",
    "\n",
    "* Import Matplotlib, pandas, and Seaborn using the standard names.\n",
    "* Create a DataFrame named df from the csv file located at csv_filepath.\n",
    "* Use the `countplot()` function with the x= and data= arguments to create a count plot with the \"Spiders\" column values on the x-axis.\n",
    "* Display the plot."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 50,
   "id": "1b628f8f",
   "metadata": {},
   "outputs": [
    {
     "data": {
      "image/png": "\n",
      "text/plain": [
       "<Figure size 432x288 with 1 Axes>"
      ]
     },
     "metadata": {
      "needs_background": "light"
     },
     "output_type": "display_data"
    }
   ],
   "source": [
    "# Create a count plot with \"Spiders\" on the x-axis\n",
    "sns.countplot(x=\"Spiders\", data=df)\n",
    "\n",
    "# Display the plot\n",
    "plt.show()"
   ]
  },
